import React from 'react';
import { Button } from 'reactstrap';
import 'react-toastify/dist/ReactToastify.css';
import useCopy from "@react-hook/copy";
import Swal from 'sweetalert2';
import { useTranslation } from 'react-i18next';

export interface ICopyModeratorLinkButtonInActiveCall{
    moderatorLink: string,
    buttonIcon: string
}

const CopyModeratorLinkButtonInActiveCall : React.FC<ICopyModeratorLinkButtonInActiveCall> = ({moderatorLink, buttonIcon}) => {
    const { copy } = useCopy(moderatorLink);    
    const { t } = useTranslation();
    return(
        <>
            <Button
            type="button"
            color="none"
            onClick={() => {
                copy();
                Swal.fire({
                    position: "top-start",
                    icon: "success",
                    title: t("Copied to clipboard a moderator invite!"),
                    showConfirmButton: false,
                    timer: 1500,
                    customClass: {
                      popup: "swal-mini-popup",
                    },
                    backdrop: false
                });
            }}
            className="nav-btn user-profile-show"
            style={{
                color: "black",
            }}
            >
                <i style={{
                    backgroundColor: "white",
                    borderRadius: 8,
                }}
                className={buttonIcon}></i>
            </Button>
        </>
    );
}

export default CopyModeratorLinkButtonInActiveCall;
